// SPDX-License-Identifier: MIT
pragma solidity ^0.8.13;

contract MyFunctions {
    address internal owner;

    constructor() {
        owner = msg.sender;
    }

    function getResult() internal pure returns (uint) {
        uint a = 1; // variavel local
        uint b = 10;
        uint result = a + b;
        return result;
    }

    modifier onlyOwner {
        require(msg.sender == owner);
        _;
    }

    function getResult2(uint _x, uint _y) internal pure returns(uint) {
        return _x + _y;
    }
    
    function testFunction1() public pure returns (uint) {
        return getResult();
    }

    function testFunction2(uint _x, uint _y) public view onlyOwner returns (uint) {
        return getResult2(_x, _y);
    }
}

